import "./OutfitFeedDisplay.css";
import { useContext, useEffect } from "react";
import { FeedContext } from "../AppMain";
import { TopDisplay } from "./TopDisplay/TopDisplay";
import { BottomDisplay } from "./BottomDisplay/BottomDisplay";
import { ShoeDisplay } from "./ShoeDisplay/ShoeDisplay";
import { Tooltip } from "react-tooltip";
import feedButtonMax from "../images/waistMaxIcon.svg";
import feedButton from "../images/waistIncrementIcon.svg";
import thumbsUp from "../images/thumbsUp.svg";
import thumbsDown from "../images/thumbsDown.svg";

export const OutfitFeedDisplay = (props) => {
	// Source feed from provider
	const {
		outfitFeed,
		refetchExpandFeed,
		feedStatus,
		setFeedStatus,
		rateOutfitMutation,
		subPage,
	} = useContext(FeedContext);

	// Define variable for feedDisplayCount
	let displayCount = props.displayCount || 3;

	// Create a function that increments the feed index
	const incrementFeed = () => {
		setFeedStatus((prev) => {
			const next = { ...prev };
			next.feedLength = feedStatus.feedLength;
			next.currIndex = Math.min(
				prev.currIndex + displayCount,
				prev.feedLength - displayCount
			);
			return next;
		});
		if (feedStatus.currIndex + displayCount + 10 >= feedStatus.feedLength) {
			refetchExpandFeed();
			console.log("Expanding Feed");
		}
	};

	// Create a function that decrements the feed index
	const decrementFeed = () => {
		if (feedStatus.currIndex === 0) {
			return;
		}
		setFeedStatus((prev) => {
			const next = { ...prev };
			next.feedLength = feedStatus.feedLength;
			next.currIndex = Math.max(prev.currIndex - displayCount, 0);
			return next;
		});
	};

	// Create an array to iterate over when generating the feed
	const feedArray = [];
	for (let i = 0; i < displayCount; i++) {
		feedArray.push(i);
	}

	// useEffect that increments and decrements each time the feedLength changes
	useEffect(() => {
		incrementFeed();
		decrementFeed();
	}, [feedStatus.feedLength, incrementFeed, decrementFeed]);
	return (
		<div className="Outfit-Feed-Display">
			<button
				className="Outfit-Feed-Button"
				onClick={decrementFeed}
				data-tooltip-id="decrementFeed">
				<img
					className="Outfit-Feed-Button-Left"
					src={
						feedStatus.currIndex === 0 ? feedButtonMax : feedButton
					}
					alt={"-"}
				/>
			</button>
			{feedArray.map((i, index) => (
				<div className="Outfit-Feed-Item" key={index}>
					<div className="Outfit-Rating-Button-Container">
						<button
							className="Outfit-Rating-Button"
							data-tooltip-id="positiveRate"
							onClick={(event) => {
								// Return if outfit has already been rated Pos recently
								if (
									event.target.classList.contains(
										"Outfit-Rating-Img-Pos-Clicked"
									)
								) {
									return;
								}
								// Call mutation to rate outfit
								rateOutfitMutation.mutate([
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].top
									].top.productColors,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].bottom
									].bottom.productColors,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].shoe
									].shoes.productColors,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].top
									].top._id,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].bottom
									].bottom._id,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].shoe
									].shoes._id,
									1,
								]);
								// Add class to img to signal rating
								event.target.classList.add(
									"Outfit-Rating-Img-Pos-Clicked"
								);
								// Remove the class in .5 seconds
								const likeTimeout = setTimeout(() => {
									// Check if the website is still on the same page, if not, clear the timeout
									if (subPage !== "/generator") {
										clearTimeout(likeTimeout);
										return;
									}
									// Remove the class
									event.target.classList.remove(
										"Outfit-Rating-Img-Pos-Clicked"
									);
									// Clear the timeout
									clearTimeout(likeTimeout);
								}, 500);
							}}>
							<img
								src={thumbsUp}
								alt="Rate-Pos"
								className="Outfit-Rating-Img-Pos"
							/>
						</button>
						<button
							className="Outfit-Rating-Button"
							data-tooltip-id="negativeRate"
							onClick={(event) => {
								// Return if outfit has already been rated Neg recently
								if (
									event.target.classList.contains(
										"Outfit-Rating-Img-Neg-Clicked"
									)
								) {
									return;
								}
								// Call mutation to rate outfit
								rateOutfitMutation.mutate([
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].top
									].top.productColors,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].bottom
									].bottom.productColors,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].shoe
									].shoes.productColors,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].top
									].top._id,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].bottom
									].bottom._id,
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex + i
										].shoe
									].shoes._id,
									0,
								]);
								// Add class to img to signal rating
								event.target.classList.add(
									"Outfit-Rating-Img-Neg-Clicked"
								);
								// Remove the class in .5 seconds
								const dislikeTimeout = setTimeout(() => {
									// Check if the website is still on the same page, if not, clear the timeout
									if (subPage !== "/generator") {
										clearTimeout(dislikeTimeout);
									}
									// Remove the class
									event.target.classList.remove(
										"Outfit-Rating-Img-Neg-Clicked"
									);
									// Clear the timeout
									clearTimeout(dislikeTimeout);
								}, 500);
							}}>
							<img
								src={thumbsDown}
								alt="Rate-Neg"
								className="Outfit-Rating-Img-Neg"
							/>
						</button>
					</div>

					<TopDisplay
						item={
							outfitFeed.pallet[
								outfitFeed.outfits[feedStatus.currIndex + i].top
							].top
						}
					/>

					<BottomDisplay
						item={
							outfitFeed.pallet[
								outfitFeed.outfits[feedStatus.currIndex + i]
									.bottom
							].bottom
						}
					/>
					<ShoeDisplay
						item={
							outfitFeed.pallet[
								outfitFeed.outfits[feedStatus.currIndex + i]
									.shoe
							].shoes
						}
					/>
				</div>
			))}
			{feedArray.map((i, index) => {
				const tempIndex = feedStatus.currIndex + displayCount + i;
				if (tempIndex >= outfitFeed.outfits.length) {
					return null;
				} else
					return (
						<div className="Outfit-Feed-Item-Buffer">
							<TopDisplay
								item={
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex +
												displayCount +
												i
										].top
									].top
								}
								invis={true}
							/>
							<BottomDisplay
								item={
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex +
												displayCount +
												i
										].bottom
									].bottom
								}
								invis={true}
							/>
							<ShoeDisplay
								item={
									outfitFeed.pallet[
										outfitFeed.outfits[
											feedStatus.currIndex +
												displayCount +
												i
										].shoe
									].shoes
								}
								invis={true}
							/>
						</div>
					);
			})}
			<button
				className="Outfit-Feed-Button-EndDiv"
				data-tooltip-id="incrementFeed"
				onClick={incrementFeed}>
				<img
					className="Outfit-Feed-Button-Right"
					src={
						feedStatus.currIndex + displayCount >
						feedStatus.feedLength - 1
							? feedButtonMax
							: feedButton
					}
					alt={"+"}
				/>
			</button>
			<Tooltip
				id="decrementFeed"
				place="top"
				effect="solid"
				content="Previous Outfit"
			/>
			<Tooltip
				id="incrementFeed"
				place="top"
				effect="solid"
				content="Next Outfit"
			/>
			<Tooltip
				id="positiveRate"
				place="top"
				effect="solid"
				content="Like Outfit"
			/>
			<Tooltip
				id="negativeRate"
				place="top"
				effect="solid"
				content="Dislike Outfit"
			/>
			<Tooltip
				id="reportRate"
				place="top"
				effect="solid"
				content="Report Item"
			/>
		</div>
	);
};
